import React from 'react';


class Layout extends React.Component {
    shouldComponentUpdate() {
        return false
    }

    render() {
        <FlexContainer>
            <div>{this.props.leftSide}</div>
            <div>{this.props.rightSide}</div>
        </FlexContainer>
    }
}
